INSERT INTO `clinics` (`id`, `name`, `address`, `decscriptionHTML`, `descriptionMarkDown`, `image`, `createdAt`, `updatedAt`) VALUES
(2, 'Phòng khám Bệnh viện Đại học Y Dược 1', '20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM', '<h2>GIỚI THIỆU</h2>\n<p>Phòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.</p>\n<p>Các bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và các bệnh viện uy tín khác trên địa bàn thành phố.</p>\n<p>Hơn nữa, phòng khám còn được đầu tư về hệ thống trang thiết bị thăm khám và điều trị đồng bộ. Một số thiết bị điển hình phải kể đến như: Máy chụp MRI, Máy chụp CT-Scanner, Máy đo loãng xương, các loại máy đo chức năng hô hấp,.... Vì vậy, phòng khám được rất nhiều người bệnh tin tưởng thăm khám.</p>\n<p><strong>Địa chỉ</strong>: 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc</strong></p>\n<p>Thứ 2 tới thứ 6: 07h30 - 16h30\nThứ 7: 07h30 - 12h00</p>\n<p><strong>Lưu ý quan trọng</strong></p>\n<p>Người bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau.\nKhi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.</p>\n<p><strong>THẾ MẠNH CHUYÊN MÔN</strong></p>\n<p>Phòng khám Bệnh viện Đại học Y Dược 1 là phòng khám đa khoa, chuyên về Nội khoa. Một số chuyên khoa thế mạnh của phòng khám có thể kể đến như:</p>\n<p>Các gói khám sức khỏe định kỳ cho cá nhân và doanh nghiệp\nChẩn đoán hình ảnh: chụp Xquang, cộng hưởng từ MRI, cắt lớp vi tính CT-Scan, siêu âm tim, siêu âm.\nCơ Xương Khớp\nHô hấp &amp; Dị ứng Miễn dịch\nNhi khoa\nNội Tiêu hóa - Viêm gan\nSản - Phụ khoa\nTai Mũi Họng\nTim mạch\nTrong các chuyên khoa thế mạnh, Khám tổng quát là dịch vụ được nhiều người sử dụng nhất ở phòng khám. Tại đây, các gói khám được lên danh mục sẵn với chi phí rõ ràng, cùng với sự hỗ trợ từ thiết bị máy móc tân tiến cùng đội ngũ bác sĩ nhiều năm kinh nghiệm giúp quá trình khám tổng quát diễn ra hiệu quả.</p>\n<p>Nhưng cũng chính vì vậy, nhiều thời điểm phòng khám khá đông đúc như vào buổi sáng các ngày đầu tuần. Bạn đọc có thể lựa chọn đi khám vào các ngày gần cuối tuần và đặt hẹn trước để tiết kiệm thời gian thăm khám.</p>\n', '\n## GIỚI THIỆU\n\n\nPhòng Khám Bệnh viện Đại học Y Dược 1 là Phòng Khám đầu tiên được thành lập theo mô hình hợp tác công - tư. Đây là phòng khám đa khoa, thuộc hệ thống các cơ sở của Bệnh viện Đại học Y Dược TP.HCM.\n\nCác bác sĩ tại Phòng khám Bệnh viện Đại học Y Dược 1 chủ yếu là đã và đang công tác trong chính Bệnh viện Đại học Y Dược TP.HCM, Bệnh viện Chợ Rẫy, bác sĩ tại Bệnh viện Nhân Dân 115 và các bệnh viện uy tín khác trên địa bàn thành phố.\n\nHơn nữa, phòng khám còn được đầu tư về hệ thống trang thiết bị thăm khám và điều trị đồng bộ. Một số thiết bị điển hình phải kể đến như: Máy chụp MRI, Máy chụp CT-Scanner, Máy đo loãng xương, các loại máy đo chức năng hô hấp,.... Vì vậy, phòng khám được rất nhiều người bệnh tin tưởng thăm khám.\n\n**Địa chỉ**: 20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. Hồ Chí Minh\n\n**Thời gian làm việc**\n\nThứ 2 tới thứ 6: 07h30 - 16h30\nThứ 7: 07h30 - 12h00\n\n**Lưu ý quan trọng**\n\nNgười bệnh nên chú ý địa chỉ phòng khám (vì có những người nhầm với địa chỉ Bệnh viện Đại học Y Dược TP.HCM cơ sở 1). Bệnh viện Đại học Y Dược TP.HCM cơ sở 1 và Phòng khám Bệnh viện Đại học Y Dược 1 là khác nhau, địa chỉ cũng tách rời nhau. \nKhi đi khám, muộn nhất 15h45 (thứ 2 - thứ 6) và 11h15 (thứ 7) người bệnh phải có mặt ở phòng khám. Nếu được nên đi khám trước 2-3 tiếng thời gian kết thúc để có thể làm xét nghiệm, chụp chiếu xong.\n\n**THẾ MẠNH CHUYÊN MÔN**  \n\nPhòng khám Bệnh viện Đại học Y Dược 1 là phòng khám đa khoa, chuyên về Nội khoa. Một số chuyên khoa thế mạnh của phòng khám có thể kể đến như:\n\nCác gói khám sức khỏe định kỳ cho cá nhân và doanh nghiệp\nChẩn đoán hình ảnh: chụp Xquang, cộng hưởng từ MRI, cắt lớp vi tính CT-Scan, siêu âm tim, siêu âm. \nCơ Xương Khớp\nHô hấp & Dị ứng Miễn dịch\nNhi khoa\nNội Tiêu hóa - Viêm gan\nSản - Phụ khoa\nTai Mũi Họng\nTim mạch \nTrong các chuyên khoa thế mạnh, Khám tổng quát là dịch vụ được nhiều người sử dụng nhất ở phòng khám. Tại đây, các gói khám được lên danh mục sẵn với chi phí rõ ràng, cùng với sự hỗ trợ từ thiết bị máy móc tân tiến cùng đội ngũ bác sĩ nhiều năm kinh nghiệm giúp quá trình khám tổng quát diễn ra hiệu quả.\n\nNhưng cũng chính vì vậy, nhiều thời điểm phòng khám khá đông đúc như vào buổi sáng các ngày đầu tuần. Bạn đọc có thể lựa chọn đi khám vào các ngày gần cuối tuần và đặt hẹn trước để tiết kiệm thời gian thăm khám.', , '2023-06-12 10:43:21', '2023-06-12 10:43:21');
INSERT INTO `clinics` (`id`, `name`, `address`, `decscriptionHTML`, `descriptionMarkDown`, `image`, `createdAt`, `updatedAt`) VALUES
(3, 'Bệnh viện Hữu nghị Việt Đức', 'Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội', '<h2>GIỚI THIỆU</h2>\n<p><strong>Địa chỉ</strong>:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p>\n<p>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\nThời gian làm việc: Thứ 2 đến thứ 7</p>\n<p>Sáng: 7h00 - 12h00\nChiều: 13h30 - 16h30\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p>\n<p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p>\n<p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p>\n<p>**Lưu ý quan trọng\n**\nBệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.\nBệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\nNgười bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.</p>\n<p><strong>Chi phí khám</strong></p>\n<p>Người bệnh có thể lựa chọn một trong các gói khám sau:</p>\n<p>Gói 1:\nKhám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\nKhám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám\nGói 2:\nKhám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám</p>\n', '\n## GIỚI THIỆU\n\n\n**Địa chỉ**:  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: \n\nSố 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội\nThời gian làm việc: Thứ 2 đến thứ 7\n\nSáng: 7h00 - 12h00\nChiều: 13h30 - 16h30\nBệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. \n\nViệt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. \n\nBệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. \n\n**Lưu ý quan trọng\n**\nBệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.\nBệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.\nNgười bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.\n\n**Chi phí khám**\n\nNgười bệnh có thể lựa chọn một trong các gói khám sau:\n\nGói 1:\nKhám Giáo sư, Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa II - Chi phí 500.000 đồng/lần khám\nKhám với bác sĩ Trưởng khoa hoặc Phó khoa - Chi phí 500.000 đồng/lần khám\nGói 2:\nKhám Thạc sĩ, Bác sĩ Chuyên khoa I - Chi phí: 300.000 đồng/lần khám\n', , '2023-06-12 10:44:43', '2023-06-12 10:44:43');
INSERT INTO `clinics` (`id`, `name`, `address`, `decscriptionHTML`, `descriptionMarkDown`, `image`, `createdAt`, `updatedAt`) VALUES
(4, 'Bệnh viện Đa khoa An Việt', 'Số 1E Trường Chinh - Thanh Xuân - Hà Nội', '<h2>GIỚI THIỆU</h2>\n<p>Bệnh viện An Việt là bệnh viện đa khoa tư nhân đã hoạt động được trên 10 năm. Bệnh viện là địa chỉ khám và điều trị uy tín về một số mặt bệnh chuyên khoa như Tai Mũi Họng, Thần kinh, Sản phụ khoa, Nam khoa,...</p>\n<p>Đội ngũ bác sĩ của bệnh viện đều là các bác sĩ nhiều năm kinh nghiệm và được bệnh nhân phản hồi tích cực về quá trình khám và điều trị. Bên cạnh đó, bệnh viện còn đầu tư cơ sở hạ tầng và trang thiết bị hỗ trợ thăm khám và điều trị hiệu quả cho người bệnh: Hệ thống nội soi tai mũi họng, máy chụp cắt lớp vi tính, phòng phẫu thuật đảm bảo vô trùng,...</p>\n<p><strong>Địa chỉ</strong>: Số 1E Trường Chinh, Thanh Xuân, Hà Nội</p>\n<p><strong>Thời gian làm việc</strong>: Thứ 2 đến Chủ Nhật</p>\n<p>Sáng: Từ 7h30 – 12h00\nChiều: Từ 13h30 – 16h30\nHình thức thanh toán: Tiền mặt, Thẻ ngân hàng</p>\n<p>Bảo hiểm bảo lãnh: Hiện tại, bệnh viện hỗ trợ thanh toán bảo hiểm y tế nhà nước với các danh mục cho phép và bảo lãnh trực tiếp nhiều loại bảo hiểm y tế tư nhân như: Insmart, VIB, PTI, Baoviet,...</p>\n<p><strong>THẾ MẠNH CHUYÊN MÔN</strong></p>\n<p>Bệnh viện có thế mạnh chẩn đoán và điều trị về các vấn đề:</p>\n<p>Tai mũi họng\nThận tiết niệu\nNam học\nThần kinh\nSản phụ khoa\nCơ xương khớp\nTrong đó, bệnh viện đặc biệt có thế mạnh trong khám, chẩn đoán và điều trị viêm VA, nạo Amidan bằng phương pháp phẫu thuật với phương pháp coblator/plasma, giúp bệnh nhân phục hồi nhanh, hạn chế chảy máu tối đa trong quá trình phẫu thuật.</p>\n', '\n## GIỚI THIỆU\n\n\nBệnh viện An Việt là bệnh viện đa khoa tư nhân đã hoạt động được trên 10 năm. Bệnh viện là địa chỉ khám và điều trị uy tín về một số mặt bệnh chuyên khoa như Tai Mũi Họng, Thần kinh, Sản phụ khoa, Nam khoa,...\n\nĐội ngũ bác sĩ của bệnh viện đều là các bác sĩ nhiều năm kinh nghiệm và được bệnh nhân phản hồi tích cực về quá trình khám và điều trị. Bên cạnh đó, bệnh viện còn đầu tư cơ sở hạ tầng và trang thiết bị hỗ trợ thăm khám và điều trị hiệu quả cho người bệnh: Hệ thống nội soi tai mũi họng, máy chụp cắt lớp vi tính, phòng phẫu thuật đảm bảo vô trùng,...\n\n**Địa chỉ**: Số 1E Trường Chinh, Thanh Xuân, Hà Nội\n\n**Thời gian làm việc**: Thứ 2 đến Chủ Nhật\n\nSáng: Từ 7h30 – 12h00\nChiều: Từ 13h30 – 16h30\nHình thức thanh toán: Tiền mặt, Thẻ ngân hàng\n\nBảo hiểm bảo lãnh: Hiện tại, bệnh viện hỗ trợ thanh toán bảo hiểm y tế nhà nước với các danh mục cho phép và bảo lãnh trực tiếp nhiều loại bảo hiểm y tế tư nhân như: Insmart, VIB, PTI, Baoviet,...\n\n**THẾ MẠNH CHUYÊN MÔN**\n\nBệnh viện có thế mạnh chẩn đoán và điều trị về các vấn đề:\n\nTai mũi họng\nThận tiết niệu\nNam học\nThần kinh\nSản phụ khoa\nCơ xương khớp\nTrong đó, bệnh viện đặc biệt có thế mạnh trong khám, chẩn đoán và điều trị viêm VA, nạo Amidan bằng phương pháp phẫu thuật với phương pháp coblator/plasma, giúp bệnh nhân phục hồi nhanh, hạn chế chảy máu tối đa trong quá trình phẫu thuật.', , '2023-06-12 10:46:04', '2023-06-12 10:46:04');
INSERT INTO `clinics` (`id`, `name`, `address`, `decscriptionHTML`, `descriptionMarkDown`, `image`, `createdAt`, `updatedAt`) VALUES
(5, 'Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108', 'Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108 ', '<h2>GIỚI THIỆU</h2>\n<p>Trung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. HHiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.</p>\n<p>Vì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:</p>\n<p>Được thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.\nĐược khám với quy trình khép kín, không phải di chuyển nhiều.\nĐược tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.\nKhu vực khám riêng tư, lịch sự.\nĐược lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.\nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.</p>\n<p><strong>Địa chỉ</strong>:Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<p>6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)\nKhám cá nhân: Thứ 2 - Thứ 6\nKhám đoàn và công ty: Thứ 7</p>\n', '\n## GIỚI THIỆU\n\n\nTrung tâm khám sức khỏe định kỳ - Bệnh viện Trung ương Quân đội 108 là đơn vị đầu ngành thực hiện chức năng khám sức khỏe định kỳ cho các cá nhân, nhóm, cơ quan. HHiện nay có khá ít bệnh viện công tuyến trung ương triển khai dịch vụ gói khám một cách chuyên nghiệp như Trung tâm khám sức khỏe định kỳ.\n\nVì vậy, Trung tâm khám sức khỏe định kỳ của Bệnh viện luôn là địa chỉ uy tín hàng đầu của người dân khi đi khám tổng quát:\n\nĐược thăm khám với các Giáo sư, Phó giáo sư, Tiến sỹ, Bác sĩ chuyên khoa có trình độ cao và đội ngũ điều dưỡng chuyên nghiệp cùng hệ thống trang thiết bị đồng bộ, hiện đại hàng đầu Việt Nam.\nĐược khám với quy trình khép kín, không phải di chuyển nhiều.\nĐược tự thiết kế những danh mục trong gói khám theo mong muốn và tư vấn của bác sĩ.\nKhu vực khám riêng tư, lịch sự.\nĐược lấy máu xét nghiệm tại khu riêng, giảm thiểu thời gian chờ đợi.\nTất cả các gói khám tổng quát đều bao gồm suất ăn miễn phí cho khách hàng tại Bệnh viện sau khi lấy mẫu máu xét nghiệm.\n\n**Địa chỉ**:Trung tâm khám sức khỏe định kì, Tầng 2, Khoa khám bệnh, Bệnh viện Trung ương quân đội 108\n\n**Thời gian làm việc:**\n\n6h30 - 17h00 (Nên Đến trước 8h30 để làm thủ tục khám nếu không thì dịch vụ siêu âm, nội soi có thể đẩy sang chiều hoặc ngày hôm sau phụ thuộc vào số lượng bệnh nhân trong ngày)\nKhám cá nhân: Thứ 2 - Thứ 6\nKhám đoàn và công ty: Thứ 7', , '2023-06-12 10:46:59', '2023-06-12 10:46:59');
INSERT INTO `clinics` (`id`, `name`, `address`, `decscriptionHTML`, `descriptionMarkDown`, `image`, `createdAt`, `updatedAt`) VALUES
(6, 'Bệnh viện Chợ Rẫy', '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', '<h2>GIỚI THIỆU</h2>\n<p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p>\n<p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p>\n<p><strong>Địa chỉ bệnh viện:</strong></p>\n<p>201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<p>Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p>\n<p>Thứ 2 đến thứ 6: từ 7h – 16h\nThứ 7: từ 7h – 11h</p>\n', '\n## GIỚI THIỆU\n\n\nBệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.\n\nBệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.\n\n**Địa chỉ bệnh viện:**\n\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh\n\n**Thời gian làm việc:**\n\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:\n\nThứ 2 đến thứ 6: từ 7h – 16h\nThứ 7: từ 7h – 11h', , '2023-06-12 10:47:39', '2023-06-12 10:47:39');
INSERT INTO `clinics` (`id`, `name`, `address`, `decscriptionHTML`, `descriptionMarkDown`, `image`, `createdAt`, `updatedAt`) VALUES
(7, ' Bệnh viện Ung bướu Hưng Việt', '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', '<h2>GIỚI THIỆU</h2>\n<p>Hệ thống Y tế Thu Cúc TCI tự hào là đơn vị y tế được hàng triệu người dân tin tưởng và Sở Y tế công nhận</p>\n<p>Huy chương vàng Dịch vụ y tế do Bộ Y tế trao tặng\nTOP 3 Bệnh viện tư nhân có điểm chất lượng dẫn đầu Hà Nội\nTOP 5 bệnh viện có điểm chất lượng cao nhất\n99% khách hàng đánh giá hài lòng theo thang điểm chấm của Sở Y tế\nHệ thống Y tế Thu Cúc TCI quy tụ đội ngũ bác sĩ gồm đông đảo các Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ giỏi chuyên môn và giàu kinh nghiệm.</p>\n<p>Đại tá, Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa II, Thầy thuốc nhân dân Nguyễn Văn Quýnh: 40 năm kinh nghiệm trong chuyên khoa Tim mạch. Hơn 30 năm công tác tại Bệnh viện Trung ương Quận đội 108\nThầy thuốc ưu tú, Bác sĩ chuyên khoa II Nguyễn Thị Kim Loan: Nguyên Trưởng khoa Cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội\nTiến sĩ, Bác sĩ Nguyễn Văn Doanh: Nguyên là chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị\nTiến sĩ, Bác sĩ Nguyễn Thị Thu Hương: Nguyên Phó Giám đốc Bệnh viện Thận Hà Nội. Hơn 30 năm kinh nghiệm khám và chữa các bệnh thận, tiết niệu\nPhó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa I, Thầy thuốc nhân dân Nguyễn Xuân Thành: Hơn 30 năm kinh nghiệm trong lĩnh vực gan mật.\nVà nhiều Phó Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ uy tín khác.</p>\n<p><strong>Địa chỉ:</strong></p>\n<p>Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội\nCơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội\nCơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội\nCơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội</p>\n<p><strong>Thời gian làm việc chung:</strong></p>\n<p>Nhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc TCI triển khai giờ làm việc như sau:</p>\n<p>Cơ sở 286 Thụy Khuê: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7\nCơ sở 216 Trần Duy Hưng: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\nCơ sở 32 Đại Từ: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\nCơ sở 136 Nguyễn Trãi: Từ 8h00 - 17h00 từ Thứ 2 đến CN hàng tuần</p>\n', '\n## GIỚI THIỆU\n\n\nHệ thống Y tế Thu Cúc TCI tự hào là đơn vị y tế được hàng triệu người dân tin tưởng và Sở Y tế công nhận\n\nHuy chương vàng Dịch vụ y tế do Bộ Y tế trao tặng\nTOP 3 Bệnh viện tư nhân có điểm chất lượng dẫn đầu Hà Nội\nTOP 5 bệnh viện có điểm chất lượng cao nhất\n99% khách hàng đánh giá hài lòng theo thang điểm chấm của Sở Y tế\nHệ thống Y tế Thu Cúc TCI quy tụ đội ngũ bác sĩ gồm đông đảo các Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ giỏi chuyên môn và giàu kinh nghiệm. \n\nĐại tá, Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa II, Thầy thuốc nhân dân Nguyễn Văn Quýnh: 40 năm kinh nghiệm trong chuyên khoa Tim mạch. Hơn 30 năm công tác tại Bệnh viện Trung ương Quận đội 108\nThầy thuốc ưu tú, Bác sĩ chuyên khoa II Nguyễn Thị Kim Loan: Nguyên Trưởng khoa Cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội\nTiến sĩ, Bác sĩ Nguyễn Văn Doanh: Nguyên là chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị\nTiến sĩ, Bác sĩ Nguyễn Thị Thu Hương: Nguyên Phó Giám đốc Bệnh viện Thận Hà Nội. Hơn 30 năm kinh nghiệm khám và chữa các bệnh thận, tiết niệu\nPhó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa I, Thầy thuốc nhân dân Nguyễn Xuân Thành: Hơn 30 năm kinh nghiệm trong lĩnh vực gan mật.\nVà nhiều Phó Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ uy tín khác.\n\n**Địa chỉ:**\n\nCơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội\nCơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội\nCơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội\nCơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội\n\n**Thời gian làm việc chung:**\n\nNhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc TCI triển khai giờ làm việc như sau:\n\nCơ sở 286 Thụy Khuê: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7\nCơ sở 216 Trần Duy Hưng: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\nCơ sở 32 Đại Từ: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\nCơ sở 136 Nguyễn Trãi: Từ 8h00 - 17h00 từ Thứ 2 đến CN hàng tuần', , '2023-06-12 10:49:27', '2023-06-12 10:49:27');
INSERT INTO `clinics` (`id`, `name`, `address`, `decscriptionHTML`, `descriptionMarkDown`, `image`, `createdAt`, `updatedAt`) VALUES
(8, 'Phòng khám Quốc tế EXSON', 'Số 722 Sư Vạn Hạnh, phường 12, Quận 10, Tp. Hồ Chí Minh', '<h2>GIỚI THIỆU</h2>\n<p>Phòng khám Quốc tế EXSON là phòng khám đa khoa tư nhân chuyên sâu về điều trị các bệnh lý cột sống và tủy sống. EXSON đã nhận được danh hiệu “Top 10 Thương Hiệu Tin Cậy” năm 2011 do tổ chức Nhịp Cầu Sức Khỏe ghi nhận.</p>\n<p>Tại phòng khám, mỗi chuyên khoa đều có những chuyên gia chỉ đạo, cố vấn và giám sát các hoạt động chuyên môn. Trong đó, nhiều bác sĩ là thành viên giảng dạy của các tổ chức y tế thế giới như AOSpine, Hội Phẫu Thuật Xâm Lấn Tối Thiểu, Ủy viên ban chấp hành Hội Phẫu Thuật Cột Sống Việt Nam, Hội Cơ Xương Khớp Việt Nam,…</p>\n<p>Phòng khám đầu tư trang thiết bị thăm khám và điều trị cơ bản, với các trường hợp phẫu thuật, phòng khám liên kết với các bệnh viện uy tín để điều trị cho người bệnh, trực tiếp các bác sĩ tại phòng khám sẽ tham gia phẫu thuật.</p>\n<p><strong>Địa chỉ</strong>: Số 722 Sư Vạn Hạnh, Phường 12, Quận 10, Tp. Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc</strong>: Từ thứ 2 đến thứ 7</p>\n<p>Sáng: 7h00 - 11h30\nChiều: 13h30 - 17h00\nHình thức thanh toán chi phí khám chữa bệnh</p>\n<p>Chi trả trực tiếp bằng tiền mặt\nChi trả qua các loại thẻ ATM</p>\n', '\n## GIỚI THIỆU\n\n\nPhòng khám Quốc tế EXSON là phòng khám đa khoa tư nhân chuyên sâu về điều trị các bệnh lý cột sống và tủy sống. EXSON đã nhận được danh hiệu “Top 10 Thương Hiệu Tin Cậy” năm 2011 do tổ chức Nhịp Cầu Sức Khỏe ghi nhận.\n\nTại phòng khám, mỗi chuyên khoa đều có những chuyên gia chỉ đạo, cố vấn và giám sát các hoạt động chuyên môn. Trong đó, nhiều bác sĩ là thành viên giảng dạy của các tổ chức y tế thế giới như AOSpine, Hội Phẫu Thuật Xâm Lấn Tối Thiểu, Ủy viên ban chấp hành Hội Phẫu Thuật Cột Sống Việt Nam, Hội Cơ Xương Khớp Việt Nam,…\n\nPhòng khám đầu tư trang thiết bị thăm khám và điều trị cơ bản, với các trường hợp phẫu thuật, phòng khám liên kết với các bệnh viện uy tín để điều trị cho người bệnh, trực tiếp các bác sĩ tại phòng khám sẽ tham gia phẫu thuật.\n\n**Địa chỉ**: Số 722 Sư Vạn Hạnh, Phường 12, Quận 10, Tp. Hồ Chí Minh\n\n**Thời gian làm việc**: Từ thứ 2 đến thứ 7\n\nSáng: 7h00 - 11h30\nChiều: 13h30 - 17h00\nHình thức thanh toán chi phí khám chữa bệnh\n\nChi trả trực tiếp bằng tiền mặt\nChi trả qua các loại thẻ ATM', , '2023-06-12 10:50:54', '2023-06-12 10:50:54');

