<p>Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...</p>\n</li>\n</ul>\n', '\n## 1. Bác sĩ Chuyên khoa II Trần Minh Khuyên\n\n\n* Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\n\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\n\n* Bác sĩ nhận khám từ 16 tuổi trở lên\n\n\n## 2. Quá trình đào tạo\n\n\n* Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n\n* Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n\n* Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n\n## 3. Quá trình công tác\n\n\n* Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n\n* Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n\n* Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan \n\n* pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.\n\n## 4. Khám và điều trị\n\n\n* Các rối loạn giấc ngủ không thực tổn: mất ngủ, ngủ nhiều, ngủ ngày quá mức, rối loạn nhịp thức ngủ, hoảng sợ khi\nngủ, ác mộng, ngủ rũ,...\n\n* Các rối loạn lo âu: lo lắng, sợ hãi về tương lai, cảm giác cáu gắt, căng thẳng, vận động, bồn chồn, hồi hộp, vã mồ\nhôi tay chân, cồn cào,...\n\n* Rối loạn trầm cảm: buồn chán, bi quan, mệt mỏi, giảm hoạt động,...\n\n* Hưng cảm: vui vẻ quá mức, suồng sã, tăng hoạt động, đứng ngồi không yên,...\n\n* Rối loạn hoang tưởng: hoang tưởng bị hại, bị theo dõi, liên hệ, bị tội,...\n\n* Rối loạn ảo giác\n\n* Các rối loạn liên quan đến stress\n\n* Rối loạn khí sắc\n\n* Rối loạn cảm xúc phân liệt\n\n* Rối loạn đa nhân cách\n\n* Các bệnh lý loạn thần do sử dụng chất (ma túy đá, cần sa, heroin..)...', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 22, NULL, NULL, '2023-06-03 22:10:09', '2023-06-03 22:10:09'),
(4, '<h2>1. Giáo sư, Tiến sĩ Đỗ Như Hơn</h2>\n<ul>\n<li>Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa Mắt</li>\n<li>Chuyên gia đầu ngành về Nhãn khoa</li>\n<li>Nguyên Giám đốc Bệnh viện Mắt Trung ương</li>\n<li>Danh hiệu Thầy thuốc Nhân dân</li>\n</ul>\n<h2>2. Quá trình đào tạo</h2>\n<ul>\n<li>Học hàm Giáo sư (2014)</li>\n<li>Học hàm Phó Giáo sư (2002)</li>\n<li>Tiến sĩ Y khoa, Đại học Y Hà Nội (1992 -1996)</li>\n<li>Thực tâp sinh tại Cộng hòa Pháp (1989 - 1990)</li>\n<li>Bác sĩ Nội trú Chuyên ngành Nhãn khoa, Đại học Y Hà Nội (1978 - 1980)</li>\n<li>Chuyên ngành Nhãn khoa, Đại học Y Hà Nội (1973 - 1978)</li>\n</ul>\n<h2>3. Quá trình công tác</h2>\n<ul>\n<li>Giám đốc Bệnh viện Mắt Trung ương (2007 - 2015)</li>\n<li>Phó khoa Chấn thương, Phó Viện trưởng Viện mắt (2000)</li>\n<li>Bác sĩ Bệnh viện Mắt Trung Ương (1980 - nay)</li>\n</ul>\n<h2>4. Sách và công trình nghiên cứu</h2>\n<ul>\n<li>Đề tài cấp nhà nước: &quot;Ứng dụng kỹ thuật tiên tiến trong điều trị một số bệnh lý nhãn khoa&quot;</li>\n<li>Đề tài cấp Bộ: &quot;Nghiên cứu đào tạo chuyển giao phát triển kỹ thuật dịch kính võng mạc cho một số tỉnh thành phố.</li>\n<li>Xây dựng bộ giáo trình Nhãn khoa dành cho công tác đào tạo sau đại học: CKI, Nội trú, Cao học và bộ giáo trình</li>\n<li>Điều dưỡng Nhãn khoa dành cho công tác đào tạo Điều dưỡng chuyên khoa Mắt</li>\n</ul>\n<h2>5. Giải thưởng</h2>\n<ul>\n<li>Thầy thuốc Nhân dân</li>\n</ul>\n<h2>6. Thành viên các Hội khoa học, tổ chức chuyên môn</h2>\n<ul>\n<li>Phó Chủ tịch Ủy ban Quốc gia Phòng chống mù lòa</li>\n</ul>\n<h2>Khám và điều trị</h2>\n<h2>Dịch kính võng mạc</h2>\n<ul>\n<li>Bong võng mạc</li>\n<li>Thoái hóa võng mạc</li>\n<li>Thoái hóa dịch kính võng mạc</li>\n<li>Bệnh võng mạc đái tháo đường</li>\n<li>Bệnh thoái hóa hoàng điểm tuổi già</li>\n<li>Các bệnh võng mạc trong các bệnh lý toàn thân</li>\n<li>Viêm màng bồ đào</li>\n<li>Viêm nội nhãn</li>\n<li>Xuất huyết dịch kính</li>\n</ul>\n<h2>Chấn thương</h2>\n<ul>\n<li>Chấn thương mắt</li>\n<li>Chấn thương mi</li>\n<li>Chấn thương lệ đạo</li>\n<li>Dị vật kết giác mạc</li>\n<li>Dị vật nội nhãn</li>\n</ul>\n<h2>Các bệnh lí về mắt</h2>\n<ul>\n<li>Mắt hột</li>\n<li>Khám, điều trị bệnh thiên đầu thống (glocom)</li>\n</ul>\n<h2>Tật khúc xạ</h2>\n<ul>\n<li>Cận thị</li>\n<li>Nhược thị</li>\n<li>Viễn thị</li>\n<li>Lão thị</li>\n<li>Loạn thị</li>\n</ul>\n<h2>Các rối loạn về mắt</h2>\n<ul>\n<li>Hội chứng khô mắt</li>\n<li>Rối loạn ở hốc mắt</li>\n<li>Rối loạn tuyến lệ</li>\n<li>Tăng nhãn áp</li>\n</ul>\n<h2>Các bệnh lí khác về mắt</h2>\n<ul>\n<li>Quặm mi</li>\n<li>Sa mí mắt</li>\n<li>Viêm kết mạc</li>\n<li>Lác mắt</li>\n<li>Mộng thịt</li>\n<li>Song thị</li>\n<li>Viêm giác mạc</li>\n<li>Viêm mi mắt</li>\n<li>Bong võng mạc</li>\n<li>Rách võng mạc</li>\n<li>Đục thủy tinh thể</li>\n</ul>\n<h2>Thủ thuật</h2>\n<ul>\n<li>Lấy sạn vôi kết mạc</li>\n<li>Thông lệ đạo 1 mắt</li>\n<li>Tiêm cạnh nhãn cầu</li>\n<li>Khâu kết mạc</li>\n<li>Khâu vết thương da mi</li>\n</ul>\n', '\n## 1. Giáo sư, Tiến sĩ Đỗ Như Hơn\n\n\n* Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa Mắt\n* Chuyên gia đầu ngành về Nhãn khoa\n* Nguyên Giám đốc Bệnh viện Mắt Trung ương\n* Danh hiệu Thầy thuốc Nhân dân\n\n\n## 2. Quá trình đào tạo\n\n\n* Học hàm Giáo sư (2014)\n* Học hàm Phó Giáo sư (2002)\n* Tiến sĩ Y khoa, Đại học Y Hà Nội (1992 -1996)\n* Thực tâp sinh tại Cộng hòa Pháp (1989 - 1990)\n* Bác sĩ Nội trú Chuyên ngành Nhãn khoa, Đại học Y Hà Nội (1978 - 1980)\n* Chuyên ngành Nhãn khoa, Đại học Y Hà Nội (1973 - 1978)\n\n\n## 3. Quá trình công tác\n* Giám đốc Bệnh viện Mắt Trung ương (2007 - 2015)\n* Phó khoa Chấn thương, Phó Viện trưởng Viện mắt (2000)\n* Bác sĩ Bệnh viện Mắt Trung Ương (1980 - nay)\n## 4. Sách và công trình nghiên cứu\n* Đề tài cấp nhà nước: \"Ứng dụng kỹ thuật tiên tiến trong điều trị một số bệnh lý nhãn khoa\"\n* Đề tài cấp Bộ: \"Nghiên cứu đào tạo chuyển giao phát triển kỹ thuật dịch kính võng mạc cho một số tỉnh thành phố.\n* Xây dựng bộ giáo trình Nhãn khoa dành cho công tác đào tạo sau đại học: CKI, Nội trú, Cao học và bộ giáo trình \n* Điều dưỡng Nhãn khoa dành cho công tác đào tạo Điều dưỡng chuyên khoa Mắt\n## 5. Giải thưởng\n* Thầy thuốc Nhân dân\n## 6. Thành viên các Hội khoa học, tổ chức chuyên môn\n* Phó Chủ tịch Ủy ban Quốc gia Phòng chống mù lòa\n## Khám và điều trị\n## Dịch kính võng mạc\n* Bong võng mạc\n* Thoái hóa võng mạc\n* Thoái hóa dịch kính võng mạc\n* Bệnh võng mạc đái tháo đường\n* Bệnh thoái hóa hoàng điểm tuổi già\n* Các bệnh võng mạc trong các bệnh lý toàn thân\n* Viêm màng bồ đào\n* Viêm nội nhãn\n* Xuất huyết dịch kính\n## Chấn thương\n* Chấn thương mắt\n* Chấn thương mi\n* Chấn thương lệ đạo\n* Dị vật kết giác mạc\n* Dị vật nội nhãn\n## Các bệnh lí về mắt\n* Mắt hột\n* Khám, điều trị bệnh thiên đầu thống (glocom)\n## Tật khúc xạ\n* Cận thị\n* Nhược thị\n* Viễn thị\n* Lão thị\n* Loạn thị\n## Các rối loạn về mắt\n* Hội chứng khô mắt\n* Rối loạn ở hốc mắt\n* Rối loạn tuyến lệ\n* Tăng nhãn áp\n## Các bệnh lí khác về mắt\n* Quặm mi\n* Sa mí mắt\n* Viêm kết mạc\n* Lác mắt\n* Mộng thịt\n* Song thị\n* Viêm giác mạc\n* Viêm mi mắt\n* Bong võng mạc\n* Rách võng mạc\n* Đục thủy tinh thể\n## Thủ thuật \n* Lấy sạn vôi kết mạc\n* Thông lệ đạo 1 mắt\n* Tiêm cạnh nhãn cầu\n* Khâu kết mạc\n* Khâu vết thương da mi', 'Nguyên Giám đốc Bệnh viện Mắt Trung ương\nĐược phong tặng Danh hiệu Thầy thuốc Nhân dân', 20, NULL, NULL, '2023-06-03 22:18:27', '2023-06-12 15:25:45'),
(5, '<h2>1. PGS, TS, Giảng viên cao cấp Trần Hữu Bình</h2>\n<ul>\n<li>Danh hiệu Thầy thuốc Nhân dân</li>\n<li>Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh</li>\n<li>Nguyên Viện trưởng Viện Sức khoẻ Tâm thần quốc gia, Bệnh viện Bạch Mai</li>\n<li>Nguyên Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n<li>Bác sĩ không nhận khám tự kỉ và chậm nói</li>\n</ul>\n<h2>2. Quá trình công tác</h2>\n<ul>\n<li>PGS.TS.BS Khám bệnh tại Trung tâm Y khoa số 1, Bệnh viện Đại học Y Hà Nội</li>\n<li>Chủ trì Hội chẩn lâm sàng bệnh nhân Tâm thần tại Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai</li>\n<li>Đào tạo (giảng dạy, hướng dẫn, chấm luận án) Tiến sĩ, Thạc sĩ, Bác sĩ chuyên khoa II, Bác sĩ nội trú chuyên ngành</li>\n<li>Tâm thần, Y tế công cộng của Trường Đại học Y Hà Nội</li>\n<li>Viện trưởng Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (2008 – 2011)</li>\n<li>Trưởng khoa điều trị Nghiện chất Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2010 – 2014)</li>\n<li>Trưởng khoa điều trị loạn thần Nam Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (1995 – 2008)</li>\n<li>Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội (1995 - 2014)</li>\n<li>Bác sĩ – cán bộ giảng dạy, Bộ môn Tâm thầnTrường Đại học Y Hà Nội (1978 - 1994)</li>\n</ul>\n<h2>3. Quá trình đào tạo</h2>\n<ul>\n<li>Giảng viên cao cấp chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2014)</li>\n<li>Phó Giáo sư chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2007)</li>\n<li>Tiến sĩ chuyên ngành Tâm thần, Trường Đại học Y Hà Nội (2003)</li>\n</ul>\n<h2>4. Sách và các công trình nghiên cứu khoa học</h2>\n<ul>\n<li>Tham gia biên soạn chủ biên và đồng chủ biên 16 đầu sách là giáo trình giảng dạy, sách chuyên khảo chuyên ngành Tâm thần học và y học nói chung (2003 - 2018)</li>\n<li>Trên 50 công trình nghiên cứu khoa học đăng tải trong các tạp chí khoa học có uy tín (Tạp chí Nghiên cứu khoa học Đại học Y Hà Nội, tạp chí Tổng hội Y Dược học Việt Nam, tạp chí Y học thực hành Bộ Y tế, tạp chí Hội Tâm thần học Việt Nam). (1992 - 2020)</li>\n<li>Hướng dẫn bảo vệ thành công 31 luận án Tiến sĩ, luận văn Thạc sĩ, Bác sĩ chuyên khoa cấp 2, Bác sĩ nội trú Bệnh viện, Y tế công cộng Đại học Y Hà Nội (2003 - 2020)</li>\n</ul>\n<h2>5. Thành viên các hội khoa học, tổ chức chuyên môn</h2>\n<ul>\n<li>Ban chấp hành Hội Tâm thần học Việt Nam</li>\n<li>Phó Chủ tịch Hội đồng khoa học Viện Nghiên cứu Điều trị các bệnh hiểm nghèo</li>\n</ul>\n<h2>6. Bác sĩ từ xa</h2>\n<ul>\n<li>Các rối loạn giấc ngủ: Mất ngủ, ngủ nhiều, ác mộng, hoảng sợ khi ngủ, rối loạn nhịp thức ngủ, đi trong giấc ngủ (chứng miên hành).</li>\n</ul>\n<h2>7. Các rối loạn liên quan đến Stress và dạng cơ thể:</h2>\n<ul>\n<li>Đau dai dẳng các loại: Đau đầu, đau ngực, đau bụng, đau mọi vị trí không xác định trong cơ thể.</li>\n<li>Rối loạn thần kinh thực vật</li>\n<li>Rối loạn hệ thống tim mạch: Tim đập nhanh, hồi hộp đánh trống ngực, cảm giác đè nặng ngực, nghẹt thở, huyết áp dao động.</li>\n<li>Rối loạn dạ dày - ruột: đau bụng, đầy hơi, trào ngược dạ dày, trào ngược thực quản.</li>\n<li>Rối loạn hệ thống hô hấp: Tức ngực, khó thở, đoản hơi.</li>\n<li>Rối loạn hệ thống tiết niệu - sinh dục: Đái nhiều, đái nóng, đái dắt; giảm ham muốn tình dục, nam rối loạn cương, nữ rối loạn kinh nguyệt.</li>\n</ul>\n<h2>8. Rối loạn sự thích ứng:</h2>\n<ul>\n<li>Trầm cảm: Buồn chán, mất thích thú, mệt mỏi, vô lực, giảm tập trung chú ý, kém tự tin, nhìn tương lai ảm đạm và bi quan.Lo âu, rối loạn cảm xúc và hành vi,…</li>\n<li>Các rối loạn cảm xúc: Trầm cảm, hưng cảm, cảm xúc dao động, …</li>\n<li>Các rối loạn tâm ký nặng: Hoang tưởng, Ảo giác, rối loạn phân liệt,…</li>\n<li>Trẻ em: Tự kỷ, tăng động giảm chú ý, tíc, đái dầm, ỉa đùn, nói lắp, trầm cảm, rối loạn cảm xúc và hành vi, rối loạn</li>\n<li>vận động định hình.</li>\n<li>Người già: Trầm cảm, sa sút trí tuệ, lú lẫn, hoang tưởng, ảo giác.</li>\n<li>Các vấn đề tâm lý ở phụ nữ các giai đoạn: Dậy thì, mang thai, sinh đẻ, mãn kinh,…</li>\n<li>Rối loạn ăn uống: Chán ăn, ăn vô độ, béo phì.</li>\n<li>Rối loạn tình dục: Mất ham muốn, xuất tinh sớm, bất lực, lãnh cảm, đau khi giao hợp, rối loạn phân định giới tính,…</li>\n<li>Các vấn đề về nghiện: Nghiện rượu, ma tuý, Game Online, Internet, …</li>\n</ul>\n', '\n## 1. PGS, TS, Giảng viên cao cấp Trần Hữu Bình\n* Danh hiệu Thầy thuốc Nhân dân\n* Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh\n* Nguyên Viện trưởng Viện Sức khoẻ Tâm thần quốc gia, Bệnh viện Bạch Mai\n* Nguyên Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội\n* Bác sĩ nhận khám mọi độ tuổi\n* Bác sĩ không nhận khám tự kỉ và chậm nói\n## 2. Quá trình công tác\n* PGS.TS.BS Khám bệnh tại Trung tâm Y khoa số 1, Bệnh viện Đại học Y Hà Nội\n* Chủ trì Hội chẩn lâm sàng bệnh nhân Tâm thần tại Viện Sức khỏe Tâm thần, Bệnh viện Bạch Mai\n* Đào tạo (giảng dạy, hướng dẫn, chấm luận án) Tiến sĩ, Thạc sĩ, Bác sĩ chuyên khoa II, Bác sĩ nội trú chuyên ngành \n* Tâm thần, Y tế công cộng của Trường Đại học Y Hà Nội\n* Viện trưởng Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (2008 – 2011)\n* Trưởng khoa điều trị Nghiện chất Viện Sức khoẻ Tâm thần, Bệnh viện Bạch Mai (2010 – 2014)\n* Trưởng khoa điều trị loạn thần Nam Viện Sức khoẻ Tâm thần , Bệnh viện Bạch Mai (1995 – 2008)\n* Phó Chủ nhiệm Bộ môn Tâm thần, Trường Đại học Y Hà Nội (1995 - 2014)\n* Bác sĩ – cán bộ giảng dạy, Bộ môn Tâm thầnTrường Đại học Y Hà Nội (1978 - 1994)\n## 3. Quá trình đào tạo\n* Giảng viên cao cấp chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2014)\n* Phó Giáo sư chuyên ngành Tâm thần, Bộ Giáo dục và đào tạo (2007)\n* Tiến sĩ chuyên ngành Tâm thần, Trường Đại học Y Hà Nội (2003)\n## 4. Sách và các công trình nghiên cứu khoa học\n* Tham gia biên soạn chủ biên và đồng chủ biên 16 đầu sách là giáo trình giảng dạy, sách chuyên khảo chuyên ngành Tâm thần học và y học nói chung (2003 - 2018)\n* Trên 50 công trình nghiên cứu khoa học đăng tải trong các tạp chí khoa học có uy tín (Tạp chí Nghiên cứu khoa học Đại học Y Hà Nội, tạp chí Tổng hội Y Dược học Việt Nam, tạp chí Y học thực hành Bộ Y tế, tạp chí Hội Tâm thần học Việt Nam). (1992 - 2020)\n* Hướng dẫn bảo vệ thành công 31 luận án Tiến sĩ, luận văn Thạc sĩ, Bác sĩ chuyên khoa cấp 2, Bác sĩ nội trú Bệnh viện, Y tế công cộng Đại học Y Hà Nội (2003 - 2020)\n## 5. Thành viên các hội khoa học, tổ chức chuyên môn\n* Ban chấp hành Hội Tâm thần học Việt Nam\n* Phó Chủ tịch Hội đồng khoa học Viện Nghiên cứu Điều trị các bệnh hiểm nghèo\n## 6. Bác sĩ từ xa\n* Các rối loạn giấc ngủ: Mất ngủ, ngủ nhiều, ác mộng, hoảng sợ khi ngủ, rối loạn nhịp thức ngủ, đi trong giấc ngủ (chứng miên hành).\n## 7. Các rối loạn liên quan đến Stress và dạng cơ thể:\n* Đau dai dẳng các loại: Đau đầu, đau ngực, đau bụng, đau mọi vị trí không xác định trong cơ thể.\n* Rối loạn thần kinh thực vật\n* Rối loạn hệ thống tim mạch: Tim đập nhanh, hồi hộp đánh trống ngực, cảm giác đè nặng ngực, nghẹt thở, huyết áp dao động.\n* Rối loạn dạ dày - ruột: đau bụng, đầy hơi, trào ngược dạ dày, trào ngược thực quản.\n* Rối loạn hệ thống hô hấp: Tức ngực, khó thở, đoản hơi.\n* Rối loạn hệ thống tiết niệu - sinh dục: Đái nhiều, đái nóng, đái dắt; giảm ham muốn tình dục, nam rối loạn cương, nữ rối loạn kinh nguyệt.\n## 8. Rối loạn sự thích ứng:\n* Trầm cảm: Buồn chán, mất thích thú, mệt mỏi, vô lực, giảm tập trung chú ý, kém tự tin, nhìn tương lai ảm đạm và bi quan.Lo âu, rối loạn cảm xúc và hành vi,…\n* Các rối loạn cảm xúc: Trầm cảm, hưng cảm, cảm xúc dao động, …\n* Các rối loạn tâm ký nặng: Hoang tưởng, Ảo giác, rối loạn phân liệt,…\n* Trẻ em: Tự kỷ, tăng động giảm chú ý, tíc, đái dầm, ỉa đùn, nói lắp, trầm cảm, rối loạn cảm xúc và hành vi, rối loạn \n* vận động định hình.\n* Người già: Trầm cảm, sa sút trí tuệ, lú lẫn, hoang tưởng, ảo giác.\n* Các vấn đề tâm lý ở phụ nữ các giai đoạn: Dậy thì, mang thai, sinh đẻ, mãn kinh,…\n* Rối loạn ăn uống: Chán ăn, ăn vô độ, béo phì.\n* Rối loạn tình dục: Mất ham muốn, xuất tinh sớm, bất lực, lãnh cảm, đau khi giao hợp, rối loạn phân định giới tính,…\n* Các vấn đề về nghiện: Nghiện rượu, ma tuý, Game Online, Internet, … ', 'Bác sĩ đầu ngành chuyên khoa Tâm thần, tâm bệnh\nNguyên Viện trưởng Viện Sức khoẻ Tâm thần quốc gia, Bệnh viện Bạch Mai\nNguyên Phó Chủ nhiệm Bộ môn Tâm thần trường Đại học Y Hà Nội\nBác sĩ nhận khám mọi độ tuổi\nBác sĩ không nhận khám tự kỉ và chậm nói', 23, NULL, NULL, '2023-06-03 22:26:45', '2023-06-12 15:27:11'),
(6, '<h2>1. Tiến sĩ, Bác sĩ Nguyễn Thị Thanh Thủy</h2>\n<ul>\n<li>35 năm kinh nghiệm lĩnh vực Cơ xương khớp</li>\n<li>Hiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1</li>\n<li>Từng công tác tại các bệnh viện lớn: Bệnh viện An Bình, Bệnh viện Trưng Vương, Bệnh viện Nhân dân 115</li>\n<li>Bác sĩ nhận khám từ 15 tuổi lên</li>\n</ul>\n<h2>2. Khám và điều trị</h2>\n<ul>\n<li>Đau thần kinh tọa</li>\n<li>Thoát vị đĩa đệm</li>\n<li>Viêm khớp dạng thấp</li>\n<li>Viêm cột sống dính khớp</li>\n<li>Thoái hóa khớp, cột sống cổ, cột sống thắt lưng</li>\n<li>Viêm quanh khớp vai, điểm bám các gân</li>\n<li>Bệnh loãng xương</li>\n<li>Nội soi các khớp, yếu cơ</li>\n</ul>\n<h2>3. Quá trình công tác</h2>\n<ul>\n<li>Hiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1</li>\n<li>Bác sĩ, Giám đốc - Bệnh viện Quận 8 (2009 - 2018)</li>\n<li>Bác sĩ, Trưởng khoa - Bệnh viện Trưng Vương (1997 - 2009)</li>\n<li>Bác sĩ, Phó khoa - Bệnh viện Nhân dân 115 (1993 - 1997)</li>\n<li>Bác sĩ - Bệnh viện An Bình (1988 - 1993)</li>\n</ul>\n<h2>4. Quá trình đào tạo</h2>\n<ul>\n<li>Tốt nghiệp Tiến sĩ Y khoa Trường Đại học Y Dược TP. Hồ Chí Minh (2018)</li>\n<li>Tốt nghiệp Thạc sĩ Y học Trường Đại học Y Dược TP. Hồ Chí Minh (2002)</li>\n<li>Tu nghiệp về đánh giá và điều trị đau tại Centre d’Évaluation et de Traitement de la douleur, Hôpital Saint Antoine - Pháp (1993)</li>\n<li>Tốt nghiệp Bác sĩ Trường Đại học Y Dược TP. Hồ Chí Minh (1987)</li>\n</ul>\n<h2>5. Sách và các công trình nghiên cứu, báo cáo khoa học</h2>\n<p>Chủ nhiệm các đề tài:</p>\n<ul>\n<li>“Pain incidence, assessment, and management in Vietnam: a cross-sectional study of 12,136 respondents”, là  Cộng sự tham gia nghiên cứu, Đăng trên“Journal of Pain Research ” 2019; 12: 769 - 777; Published online 2019\nFeb 25; doi: 10.2147/JPR.S184713</li>\n<li>“Tỷ lệ, cơ cấu, và một số yếu tố liên quan đến đau mạn tính ở người dân các quận nội thành TPHCM”, Năm 2013,Đăng trên Tạp chí “NỘI KHOA VIỆT NAM” tháng 6/2015</li>\n<li>“Cơ cấu, tỷ lệ và các yếu tố liên quan đến đau mạn tính tại TPHCM”, Năm 2014, Đăng trên Tạp chí “Y-Dược học quân sự” số 6 - 2014</li>\n<li>“Cơ cấu, tỷ lệ và các yếu tố liên quan đến đau mạn tính hệ vận động tại TPHCM”, Năm 2014, Đăng trên Tạp chí “Y học Việt Nam” tháng 7 – số 1/2014</li>\n<li>“Góp phần chứng minh hiệu quả và so sánh tác dụng của các thuốc Alendronate-Calcium-Vit D3 và Calcium-Vit D3 lên mật độ khoáng xương ở những bệnh nhân giảm mật độ khoáng xương”, Năm 2007 “Khảo sát mật độ xương ở những người ≥ 30 tuổi đến khám tại khoa Điều Trị Đau, BVCCTV”, Năm 2004 “So sánh hiệu quả giữa Amitriptyline và Di-Antalvic trong điều trị đau sau zona”, Năm 2001, Đăng trên Tạp chí “Y học thành phố Hồ Chí Minh” Tập 7* Số 2* 2003\nViết sách:</li>\n<li>Bài ”Đau xơ cơ”, Sách”Bệnh học những bệnh cơ xương khớp thường gặp”, NXB Y học 2020</li>\n<li>“Đau mạn tính”, Đăng trên Tạp chí “Thời sự Y học” Tháng 01&amp;02/2008</li>\n<li>Bài ”Fibromyalgie”, Sách”Bệnh học một số bệnh lý cơ xương khớp thường gặp”, NXB Y học 2006</li>\n<li>Sách dịch “Đau &amp; nhân viên y tế”, NXB Mũi Cà Mau 2001</li>\n</ul>\n<h2>6. Thành viên các Hội khoa học, tổ chức chuyên môn</h2>\n<ul>\n<li>Tổng Thư ký Hội Đau TP. Hồ Chí Minh</li>\n<li>Ủy viên Ban Chấp hành Hội Thấp khớp TP. Hồ Chí Minh</li>\n<li>Ủy viên Ban Chấp hành Hội Loãng xương TP. Hồ Chí Minh</li>\n</ul>\n', '\n## 1. Tiến sĩ, Bác sĩ Nguyễn Thị Thanh Thủy\n* 35 năm kinh nghiệm lĩnh vực Cơ xương khớp\n* Hiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1\n* Từng công tác tại các bệnh viện lớn: Bệnh viện An Bình, Bệnh viện Trưng Vương, Bệnh viện Nhân dân 115\n* Bác sĩ nhận khám từ 15 tuổi lên\n\n## 2. Khám và điều trị\n* Đau thần kinh tọa\n* Thoát vị đĩa đệm\n* Viêm khớp dạng thấp\n* Viêm cột sống dính khớp\n* Thoái hóa khớp, cột sống cổ, cột sống thắt lưng\n* Viêm quanh khớp vai, điểm bám các gân\n* Bệnh loãng xương\n* Nội soi các khớp, yếu cơ\n\n## 3. Quá trình công tác\n* Hiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1 \n* Bác sĩ, Giám đốc - Bệnh viện Quận 8 (2009 - 2018)\n* Bác sĩ, Trưởng khoa - Bệnh viện Trưng Vương (1997 - 2009)\n* Bác sĩ, Phó khoa - Bệnh viện Nhân dân 115 (1993 - 1997)\n* Bác sĩ - Bệnh viện An Bình (1988 - 1993)\n\n## 4. Quá trình đào tạo\n* Tốt nghiệp Tiến sĩ Y khoa Trường Đại học Y Dược TP. Hồ Chí Minh (2018)\n* Tốt nghiệp Thạc sĩ Y học Trường Đại học Y Dược TP. Hồ Chí Minh (2002)\n* Tu nghiệp về đánh giá và điều trị đau tại Centre d’Évaluation et de Traitement de la douleur, Hôpital Saint Antoine - Pháp (1993)\n* Tốt nghiệp Bác sĩ Trường Đại học Y Dược TP. Hồ Chí Minh (1987)\n\n\n## 5. Sách và các công trình nghiên cứu, báo cáo khoa học\nChủ nhiệm các đề tài:\n\n* “Pain incidence, assessment, and management in Vietnam: a cross-sectional study of 12,136 respondents”, là  Cộng sự tham gia nghiên cứu, Đăng trên“Journal of Pain Research ” 2019; 12: 769 - 777; Published online 2019\nFeb 25; doi: 10.2147/JPR.S184713\n* “Tỷ lệ, cơ cấu, và một số yếu tố liên quan đến đau mạn tính ở người dân các quận nội thành TPHCM”, Năm 2013,Đăng trên Tạp chí “NỘI KHOA VIỆT NAM” tháng 6/2015\n* “Cơ cấu, tỷ lệ và các yếu tố liên quan đến đau mạn tính tại TPHCM”, Năm 2014, Đăng trên Tạp chí “Y-Dược học quân sự” số 6 - 2014\n* “Cơ cấu, tỷ lệ và các yếu tố liên quan đến đau mạn tính hệ vận động tại TPHCM”, Năm 2014, Đăng trên Tạp chí “Y học Việt Nam” tháng 7 – số 1/2014\n* “Góp phần chứng minh hiệu quả và so sánh tác dụng của các thuốc Alendronate-Calcium-Vit D3 và Calcium-Vit D3 lên mật độ khoáng xương ở những bệnh nhân giảm mật độ khoáng xương”, Năm 2007 “Khảo sát mật độ xương ở những người ≥ 30 tuổi đến khám tại khoa Điều Trị Đau, BVCCTV”, Năm 2004 “So sánh hiệu quả giữa Amitriptyline và Di-Antalvic trong điều trị đau sau zona”, Năm 2001, Đăng trên Tạp chí “Y học thành phố Hồ Chí Minh” Tập 7* Số 2* 2003\nViết sách:\n* Bài ”Đau xơ cơ”, Sách”Bệnh học những bệnh cơ xương khớp thường gặp”, NXB Y học 2020\n* “Đau mạn tính”, Đăng trên Tạp chí “Thời sự Y học” Tháng 01&02/2008\n* Bài ”Fibromyalgie”, Sách”Bệnh học một số bệnh lý cơ xương khớp thường gặp”, NXB Y học 2006\n* Sách dịch “Đau & nhân viên y tế”, NXB Mũi Cà Mau 2001\n\n## 6. Thành viên các Hội khoa học, tổ chức chuyên môn\n* Tổng Thư ký Hội Đau TP. Hồ Chí Minh\n* Ủy viên Ban Chấp hành Hội Thấp khớp TP. Hồ Chí Minh\n* Ủy viên Ban Chấp hành Hội Loãng xương TP. Hồ Chí Minh', '35 năm kinh nghiệm lĩnh vực Cơ xương khớp\nHiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1\nTừng công tác tại các bệnh viện lớn: Bệnh viện An Bình, Bệnh viện Trưng Vương, Bệnh viện Nhân dân 115\nBác sĩ nhận khám từ 15 tuổi lên', 19, NULL, NULL, '2023-06-03 22:33:01', '2023-06-03 22:33:01'),
(7, '<h2>1. Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Thị Hoài An</h2>\n<ul>\n<li>Phó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng</li>\n<li>Nguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương</li>\n<li>Trên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương</li>\n<li>Bác sĩ Nội trú chuyên ngành Tai Mũi Họng</li>\n<li>Bác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng</li>\n</ul>\n<h2>2. Khám &amp; điều trị</h2>\n<ul>\n<li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn</li>\n<li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em</li>\n<li>Nội soi Tai Mũi Họng</li>\n<li>Thực hiện các qui trình kỹ thuật Tai Mũi Họng</li>\n</ul>\n<h2>3. Các bệnh về tai</h2>\n<ul>\n<li>Ù tai, nghe kém, điếc đột ngột</li>\n<li>Chẩy mủ tai, viêm tai giữa cấp, mạn</li>\n<li>Vá màng nhĩ nội soi</li>\n<li>Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài</li>\n</ul>\n<h2>4. Các bệnh mũi xoang</h2>\n<ul>\n<li>Viêm mũi xoang dị ứng, viêm mũi vận mạch</li>\n<li>Viêm mũi ngạt tắc mũi mạn tính</li>\n<li>Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang</li>\n<li>Nấm mũi xoang</li>\n<li>Đau đầu mạn tính do mũi xoang…</li>\n</ul>\n<h2>5. Các bệnh về họng thanh quản</h2>\n<ul>\n<li>Ở trẻ em viêm VA, viêm mũi họng mạn tính</li>\n<li>Các biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)</li>\n<li>Viêm amiđan cấp, mạn</li>\n<li>Nạo V.A</li>\n<li>Cắt Amidan</li>\n</ul>\n<h2>6. Dịch vụ liên quan</h2>\n<ul>\n<li>Máy nội soi Tai mũi họng Medtech</li>\n<li>Máy đo nhĩ lượng</li>\n<li>Máy đo thính lực</li>\n<li>Máy cắt nạo xoang XPS Micro - SN2704 của Mỹ</li>\n<li>Máy CT (cắt lớp vi tính) 2 lát cắt</li>\n</ul>\n', '\n## 1. Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Thị Hoài An\n* Phó Giáo sư, Tiến sĩ chuyên ngành Tai Mũi Họng\n* Nguyên Trưởng khoa Tai Mũi Họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương\n* Trên 25 năm công tác tại Bệnh viện Tai Mũi Họng Trung ương\n* Bác sĩ Nội trú chuyên ngành Tai Mũi Họng\n* Bác sĩ đã từng tu nghiệp Cộng hòa Pháp về Tai Mũi Họng\n## 2. Khám & điều trị\n* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn\n* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em\n* Nội soi Tai Mũi Họng\n* Thực hiện các qui trình kỹ thuật Tai Mũi Họng\n## 3. Các bệnh về tai\n* Ù tai, nghe kém, điếc đột ngột\n* Chẩy mủ tai, viêm tai giữa cấp, mạn\n* Vá màng nhĩ nội soi\n* Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài\n## 4. Các bệnh mũi xoang\n* Viêm mũi xoang dị ứng, viêm mũi vận mạch\n* Viêm mũi ngạt tắc mũi mạn tính\n* Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang\n* Nấm mũi xoang\n* Đau đầu mạn tính do mũi xoang…\n## 5. Các bệnh về họng thanh quản\n* Ở trẻ em viêm VA, viêm mũi họng mạn tính\n* Các biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)\n* Viêm amiđan cấp, mạn\n* Nạo V.A\n* Cắt Amidan\n## 6. Dịch vụ liên quan\n* Máy nội soi Tai mũi họng Medtech\n* Máy đo nhĩ lượng\n* Máy đo thính lực\n* Máy cắt nạo xoang XPS Micro - SN2704 của Mỹ\n* Máy CT (cắt lớp vi tính) 2 lát cắt', 'Nguyên Trưởng khoa Tai mũi họng trẻ em, Bệnh viện Tai Mũi Họng Trung ương\nTrên 25 năm công tác tại Bệnh viện Tai mũi họng Trung ương\nChuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn và trẻ em', 18, NULL, NULL, '2023-06-03 22:37:24', '2023-06-03 22:37:24'),
(8, '<h2>1. Bác sĩ Chuyên khoa II Hà Quốc Hùng</h2>\n<ul>\n<li>Gần 30 năm kinh nghiệm khám và điều trị chuyên sâu về các bệnh lý Nội khoa - Cơ xương khớp cho người cao tuổi</li>\n<li>Hiện đang là Trưởng khoa Khám Theo yêu cầu và Quốc tế, Bệnh viện Lão khoa Trung ương</li>\n<li>Nguyên giảng viên bộ môn Lão khoa, Đại học Y Hà Nội</li>\n<li>Bác sĩ nhận khám từ 18 tuổi trở lên</li>\n</ul>\n<h2>2. Khám và điều trị</h2>\n<ul>\n<li>Bác sĩ khám và điều trị chuyên sâu về các bệnh lý nội khoa cho người cao tuổi</li>\n<li>Bệnh lý cơ xương khớp: loãng xương, thoái hóa khớp, thoát vị đĩa đệm,...</li>\n<li>Tiêu hóa: Đau dạ dày, trào ngược dạ dày,...</li>\n<li>Tim mạch: Tăng huyết áp, rối loạn chuyển hóa,...</li>\n<li>Đái tháo đường</li>\n<li>Parkinson</li>\n<li>Tai biến mạch máu não</li>\n</ul>\n<h2>3. Quá trình công tác</h2>\n<ul>\n<li>Giảng viên bộ môn Lão khoa, Đại học Y Hà Nội (1998 - 2006)</li>\n<li>Trưởng khoa Nội tổng hợp, Bệnh viện Lão khoa Trung ương (2007 - 7/2013)</li>\n<li>Trưởng khoa Khám Theo yêu cầu và Quốc tế, Bệnh viện Lão khoa Trung ương (8/2013 - nay)</li>\n</ul>\n<h2>4. Quá trình đào tạo</h2>\n<ul>\n<li>Học Bác sĩ Đa khoa, Đại học Y Hà Nội (1987 - 1993)</li>\n<li>Bác sĩ Nội trú bệnh viện, Đại học Y Hà Nội - Bệnh viện Bạch Mai (1994 - 1997)</li>\n</ul>\n<h2>5. Chứng chỉ trong nước hoặc nước ngoài</h2>\n<ul>\n<li>Bằng Thạc sĩ Y khoa, Đại học Y Hà Nội</li>\n<li>Bằng Bác sĩ Chuyên khoa I chuyên ngành Nội chung, Đại học Y Hà Nội</li>\n</ul>\n<h2>6. Thành viên các Hội khoa học, tổ chức chuyên môn</h2>\n<ul>\n<li>Thành viên Hội Tiết niệu thận học Hà Nội</li>\n</ul>\n<h2>7. Tham gia các chuyên đề sức khỏe trên báo chí, truyền hình</h2>\n<ul>\n<li>Tham gia các chuyên đề sức khỏe lão khoa trên kênh VOV, VTV</li>\n</ul>\n', '\n## 1. Bác sĩ Chuyên khoa II Hà Quốc Hùng\n* Gần 30 năm kinh nghiệm khám và điều trị chuyên sâu về các bệnh lý Nội khoa - Cơ xương khớp cho người cao tuổi \n* Hiện đang là Trưởng khoa Khám Theo yêu cầu và Quốc tế, Bệnh viện Lão khoa Trung ương\n* Nguyên giảng viên bộ môn Lão khoa, Đại học Y Hà Nội\n* Bác sĩ nhận khám từ 18 tuổi trở lên\n## 2. Khám và điều trị\n* Bác sĩ khám và điều trị chuyên sâu về các bệnh lý nội khoa cho người cao tuổi\n* Bệnh lý cơ xương khớp: loãng xương, thoái hóa khớp, thoát vị đĩa đệm,...\n* Tiêu hóa: Đau dạ dày, trào ngược dạ dày,...\n* Tim mạch: Tăng huyết áp, rối loạn chuyển hóa,...\n* Đái tháo đường\n* Parkinson\n* Tai biến mạch máu não\n## 3. Quá trình công tác\n* Giảng viên bộ môn Lão khoa, Đại học Y Hà Nội (1998 - 2006)\n* Trưởng khoa Nội tổng hợp, Bệnh viện Lão khoa Trung ương (2007 - 7/2013)\n* Trưởng khoa Khám Theo yêu cầu và Quốc tế, Bệnh viện Lão khoa Trung ương (8/2013 - nay)\n## 4. Quá trình đào tạo\n* Học Bác sĩ Đa khoa, Đại học Y Hà Nội (1987 - 1993)\n* Bác sĩ Nội trú bệnh viện, Đại học Y Hà Nội - Bệnh viện Bạch Mai (1994 - 1997)\n## 5. Chứng chỉ trong nước hoặc nước ngoài\n* Bằng Thạc sĩ Y khoa, Đại học Y Hà Nội\n* Bằng Bác sĩ Chuyên khoa I chuyên ngành Nội chung, Đại học Y Hà Nội\n## 6. Thành viên các Hội khoa học, tổ chức chuyên môn\n* Thành viên Hội Tiết niệu thận học Hà Nội\n## 7. Tham gia các chuyên đề sức khỏe trên báo chí, truyền hình\n* Tham gia các chuyên đề sức khỏe lão khoa trên kênh VOV, VTVt', 'Gần 30 năm kinh nghiệm khám và điều trị chuyên sâu về các bệnh lý Nội khoa - Cơ xương khớp cho người cao tuổi\nHiện đang là Trưởng khoa Khám Theo yêu cầu và Quốc tế, Bệnh viện Lão khoa Trung ương\nNguyên giảng viên bộ môn Lão khoa, Đại học Y Hà Nội\nBác sĩ nhận khám từ 18 tuổi trở lên', 16, NULL, NULL, '2023-06-03 22:46:25', '2023-06-07 22:56:03'),
(9, '<h2>1. Tiến sĩ, Bác sĩ Lê Văn Nam</h2>\n<ul>\n<li>Trưởng khoa Nội soi - Bệnh viện Tai Mũi Họng Trung Ương (2018 - nay)</li>\n<li>Giảng dạy tại Bộ môn Tai Mũi Họng, Khoa Y, trường Đại học Quốc Gia Hà Nội (2018 - nay)</li>\n</ul>\n<h2>2. Khám &amp; điều trị</h2>\n<ul>\n<li>Khám chuyên khoa Tai Mũi Họng</li>\n<li>Nội soi Tai Mũi Họng</li>\n<li>Chuyên khám và điều trị các bệnh về Tai Mũi Họng cả người lớn và trẻ em</li>\n</ul>\n<h2>3. Các bệnh về tai</h2>\n<ul>\n<li>Ù tai, nghe kém, điếc đột ngột</li>\n<li>Chẩy mủ tai, viêm tai giữa cấp, mạn Vá màng nhĩ nội soi</li>\n<li>Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài</li>\n</ul>\n<h2>4. Các bệnh mũi xoang</h2>\n<ul>\n<li>Viêm mũi xoang dị ứng, viêm mũi vận mạch</li>\n<li>Viêm mũi ngạt tắc mũi mạn tính</li>\n<li>Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang</li>\n<li>Nấm mũi xoang</li>\n<li>Đau đầu mạn tính do mũi xoang…</li>\n</ul>\n<h2>5. Các bệnh về họng thanh quản</h2>\n<ul>\n<li>Ở trẻ em viêm VA, viêm mũi họng mạn tính. Đặc biệt những biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)  nạo VA</li>\n<li>Viêm amiđan  cấp, mạn</li>\n</ul>\n<h2>6. Khám nội soi Tai mũi họng</h2>\n<ul>\n<li>Bằng khám nội soi, bác sĩ có thể khám, quan sát sâu trong mũi, các khe mũi, hình ảnh rõ nét, trung thực, giúp cho chẩn đoán chính xác, phát hiện sớm các bệnh về tai mũi họng</li>\n</ul>\n', '\n## 1. Tiến sĩ, Bác sĩ Lê Văn Nam\n* Trưởng khoa Nội soi - Bệnh viện Tai Mũi Họng Trung Ương (2018 - nay)\n* Giảng dạy tại Bộ môn Tai Mũi Họng, Khoa Y, trường Đại học Quốc Gia Hà Nội (2018 - nay)\n## 2. Khám & điều trị\n* Khám chuyên khoa Tai Mũi Họng\n* Nội soi Tai Mũi Họng\n* Chuyên khám và điều trị các bệnh về Tai Mũi Họng cả người lớn và trẻ em\n\n## 3. Các bệnh về tai\n* Ù tai, nghe kém, điếc đột ngột\n* Chẩy mủ tai, viêm tai giữa cấp, mạn Vá màng nhĩ nội soi\n* Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài\n## 4. Các bệnh mũi xoang\n* Viêm mũi xoang dị ứng, viêm mũi vận mạch\n* Viêm mũi ngạt tắc mũi mạn tính\n* Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang\n* Nấm mũi xoang\n* Đau đầu mạn tính do mũi xoang…\n## 5. Các bệnh về họng thanh quản\n* Ở trẻ em viêm VA, viêm mũi họng mạn tính. Đặc biệt những biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)  nạo VA\n* Viêm amiđan  cấp, mạn\n## 6. Khám nội soi Tai mũi họng\n* Bằng khám nội soi, bác sĩ có thể khám, quan sát sâu trong mũi, các khe mũi, hình ảnh rõ nét, trung thực, giúp cho chẩn đoán chính xác, phát hiện sớm các bệnh về tai mũi họng', 'Trưởng khoa Nội soi - Bệnh viện Tai Mũi Họng Trung Ương (2018 - nay)\nGiảng dạy tại Bộ môn Tai Mũi Họng, Khoa Y, trường Đại học Quốc Gia Hà Nội (2018 - nay)', 15, NULL, NULL, '2023-06-03 22:50:17', '2023-06-03 22:50:17');

